import React from 'react';
import { Link } from 'react-router-dom';
import ModuleHeader from '../components/ModuleHeader';

function UsersList() {
  return (
    <div>
      <ModuleHeader title="Users" />
      <div className="mb-3">
        <Link className="btn btn-primary" to="/admin/users/new">Create User</Link>
      </div>

      <div className="alert alert-info">
        No user listing endpoint is configured on the backend (GET /api/v1/users).
        You can create users with the button above. To show a users list, add a backend
        GET handler for <code>/api/v1/users</code> that returns the users or a pageable response.
      </div>
    </div>
  );
}

export default UsersList;
